import React from 'react';

function Footer() {
    return (
        <footer className="container-fluid bg-4 text-center">
            <p>Powered By <a href="https://www.blockchain.com" target="_blank" rel="noopener">BLOCKCHAIN</a></p> 
        </footer>
    )
}

export default Footer;
